import React, { useEffect, useState }from 'react';
//mport { Link, useHistory } from 'react-router-dom';
//import {FiPower, FiTrash2 } from 'react-icons/fi';


import api from '../../services/api';

import './styles.css';


class Product extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      product: [],
      response: {id: null, nome: '', descricao: '', modelo: '', tamanho: '', valor: '', quantidade: ''}
    }
  }

  componentDidMount() {


    fetch(api)
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            product: result
          });
        },
        (error) => {
          this.setState({ error });
        }
      )
  }

  render() {
    const { error, product} = this.state;

    if(error) {
      return (
        <div>Error: {error.message}</div>
      )
    } else {
      return(
        <div>
          <h2>Product List</h2>

          <table>
            <thead>
              <tr>
                <th>#ID</th>
                <th>Product Name</th>
                <th>SKU</th>
                <th>Price</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {product.map(produc => (
                <tr key={produc.id}>
                  <td>{produc.id}</td>
                  <td>{produc.name}</td>
                  <td>{produc.descricao}</td>
                  <td>{produc.modelo}</td>
                  <td>{produc.tamanho}</td>
                  <td>{produc.valor}</td>
                  <td>{produc.quantidade}</td>

                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )
    }
  }
}

export default Product;
